1) LAUDO DE ANÁLISE Nº 279.1P.0/2024 DO PRODUTO AÇAFRÃO, MARCA GOIÁS TEMPERO COM RESULTADO INSATISFATÓRIO PARA ANÁLISE DE ROTULAGEM E IDENTIFICAÇAO HISTOLÓGICA;
2) LAUDO DE ANÁLISE Nº 280.1P.0/2024 DO PRODUTO REFRESCO COM FRUTAS ADOÇADO SABOR LARANJA, MARCA DAFRUTA, COM RESULTADO SATISFATÓRIO PARA TODAS AS ANÁLISES REALIZADAS.
